import React, { Component } from 'react'
import Cards from './Cards'
export default class Marble extends Component {

  render() {
    var marbles = this.props.marble.map( item => {

      return <CardsForMarbles teamName={item.team_name} badgeImg={item.team_badge}/>
    })
    return (
      <div>

      <div className = "app">
         {marbles}
      </div>

      </div>

    )
  }
}
